import React from 'react';
import Nav from "./Nav.js";
import { MainFeed } from './homeComponents.js';
import "./styles.css";

export function About(){
    return (
        <>
            <Nav />
        </>
    )
}

export function Profile(){
    return (
        <div>
            <Nav />
        </div>
    )
}

function Home(){
    return (
        <div>
            <Nav />
            <MainFeed />
        </div>
    )
}


export function App(){
    return (
        <div>
            <Home />
        </div>
    )
}
